import * as React from 'react';
import { Avatar, Button, Card, Title, Paragraph, Text } from 'react-native-paper';
import { View, StyleSheet, Image, ScrollView, SafeAreaView } from 'react-native';
import { AntDesign } from '@expo/vector-icons';


const DishCard = (props) => (
    /* <Card style={styles.shadow} onPress={props.onPress}>
        <Card.Content>
            <Card.FeaturedTitle title={props.name} subtitle={props.description} />
            <AntDesign name="star" size={20} color="#ffcc00" >
                <Card.Cover source={{ uri: props.img }} style={{ borderRadius: 15, borderTopRightRadius: 15, borderTopLeftRadius: 15, height: '100%', width: '30%' }} />
                <Text style={{ fontSize: 15, color: '#8c8c8c' }}> {props.rating}</Text>
                <Text style={{ color: '#dedede' }}> |</Text>
                <Text style={{ fontSize: 15, color: '#8c8c8c' }}> {props.dishType}</Text>
                <Text style={{ color: '#dedede' }}> |</Text>
                <Text style={{ fontSize: 15, color: '#8c8c8c' }}> {props.cookTime}</Text>
            </AntDesign>
        </Card.Content>
    </Card> */

    <Card>
        <Card.Content>
            <Card.Cover
                style={{ position: 'fixed', width: '35%', height: '16%' }}
                source={{ uri: 'https://picsum.photos/700' }}
            />
            <Title style={{ position: 'fixed', marginLeft: '40%', width: '30%' }}>
                Card title
      </Title>
            <Paragraph
                style={{ position: 'fixed', marginLeft: '40%', marginTop: '20%' }}>
                Card content
      </Paragraph>
        </Card.Content>
    </Card>


);

const styles = StyleSheet.create({

    shadow: {
        height: 130,
        width: 370,
        marginTop: 8,
        marginBottom: 8,
        elevation: 5,
        paddingTop: 15,
        alignItems: 'left',
        float: 'left',
        borderRadius: 15,
    },
})

export default DishCard;
